void CryptData(unsigned char * pdata,int size,unsigned char * pkey,int keylen){

	for(int i = 0,j = 0; i < size ;)
	{
		pdata[i] ^= pkey[j];
		j ++;
		if (j == keylen)
		{
			j = 0; 
		}
		i ++;
	}
}


